import React from 'react'
import { Link} from 'react-router-dom'
import {userLogout} from './Profile'
export default function Homepage() {
    function userLogout(){
        localStorage.removeItem('token');
        navigate('/')
      }
    return (
        <body>
            <nav class="navMenu">
            <span className='text-gray-500'><button className='text-red-500' to="/" onClick={userLogout}>Logout</button></span>
            <span className='text-gray-500'><Link className='text-red-500' to="/profile">update profile</Link></span>
            </nav>
      </body>
    )
  }
